MongoDB document added but not displaying on website (without a refresh)<p>I have a simple todo list website. So you can create a todo list, and added &amp; delete items from the list. Meaning, there's a <code>List</code> collection and an <code>Item</code> collection, and where a <code>List</code> can have many <code>Items</code> inside of it (array of items). I have split my Mongoose (MongoDB) code into a separate file (<code>model.js</code>), and my <code>app.js</code> file is where all HTTP requests are handled. All Mongoose methods imported into <code>app.js</code> are working fine.
The issue is when I add an <code>Item</code> to a <code>List</code>, by pressing the <code>+</code> button on the website, it should show the new item in the list. </p>

<p><a href="https://i.stack.imgur.com/Y4IX0.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/Y4IX0.png" alt="enter image description here"></a></p>

<p>However, after I press the <code>+</code> button, the item still doesn't show on the list. It takes for a website refresh in order for it to show. The item does get added to the database successfully, because I can confirm that with a console log and by checking the database itself. </p>

<p>The <code>+</code> button triggers the <code>app.post('/'...</code> method in <code>app.js</code> file, in order to add the item to the list.</p>

<p>My next approach was, to use <code>Promise</code> to the <code>addItemToListInDB</code> method (in <code>model.js</code> file), and using <code>Async</code> <code>Await</code> this would ensure the item is added to the database before rendering the web page. However, I've got another issue with this approach. Instead of returning the value of the updated list (with the newly added item), I get <code>[Object Promise]</code>. And anyway the <code>Promise</code> <code>Async</code> <code>Await</code> still hasn't resolved the original issue. Not sure if a <code>Promise</code> is needed in this scenario anyway.</p>

<p>Please refer to my code below (p.s. for the sake of brevity, I've only included the <code>app.get('/'...</code> (Home route method) and <code>app.post('/'...</code> (adding items method) from <code>app.js</code> file. And the adding items method from <code>model.js</code>).</p>

<p>Also, apologies in advance for all the console logs, but I was trying to debug the issue. I didn't want to get confused with the Async Await order of execution.</p>

<p><code>app.js</code> </p>

<pre class="lang-js prettyprint-override"><code>const express = require('express');
const bodyParser = require('body-parser');
const date = require(`${__dirname}\\date.js`);
const model = require(`${__dirname}\\model.js`);
const ejs = require('ejs');
const _ = require('lodash');

const app = express();

app.use(bodyParser.urlencoded({ extended: true }));
app.set('view engine', 'ejs');
app.use(express.static('public'));

app.get('/', (req, res) =&gt; {
  const defaultListName = "Today's";
  const todayFormatted = date.getDate();
  model.DBUtility.findOneList(defaultListName, (foundList) =&gt; {
    if (!foundList) {
      model.DBUtility.createNewListInDB(defaultListName);
      res.redirect('/');
    } else { 
      res.render('list', {
        listTitlePassToH1: foundList.name,
        todayDate: todayFormatted,
        listItems: foundList.items
      });
    }
  });
});

app.post('/', (req, res) =&gt; {
  const receivedItem = req.body.newItem;
  const listName = req.body.listName;
  console.log(`before model.DBUtility.addItemToListAndGetUpdatedList(listName, receivedItem)`);
  const updatedList = model.DBUtility.addItemToListAndGetUpdatedList(listName, receivedItem);
  console.log(`After model.DBUtility.addItemToListAndGetUpdatedList(listName, receivedItem)`);
  console.log(`updatedList: ${updatedList}`);
  if (listName === "Today's") {
    res.redirect('/');
  } else {
    res.redirect('/' + listName);
  } 
});

const port = 3000;
app.listen(port, () =&gt; {
  console.log(`Server started, listening on port: ${port}`);
});

</code></pre>

<p><code>model.js</code></p>

<pre class="lang-js prettyprint-override"><code>const mongoose = require('mongoose');
const _ = require("lodash");

//connect to DB
mongoose.connect('mongodb+srv://&lt;username&gt;:&lt;password&gt;.mongodb.net/database', {useNewUrlParser: true, useUnifiedTopology: true, useFindAndModify: false });

//create schema
const itemsSchema = new mongoose.Schema ({
  name: String
});

const listSchema = new mongoose.Schema ({
  name: String,
  items: [itemsSchema]
});

const Item = mongoose.model('Item', itemsSchema);
const List = mongoose.model('List', listSchema);


class DBUtility {

    // *** DB utility methods

    static addItemToListInDB(listName, itemName) {
        return new Promise((resolve, reject) =&gt; {
            List.findOne({name: listName}, (err, foundList) =&gt; {
                if (err) {
                    console.log(err);
                    reject(err);
                } else {
                    foundList.items.push({ name: itemName });
                    foundList.save(err =&gt; {
                        if (err) {
                            console.log(err);
                        } else {
                            console.log(`Item ${itemName} added to list ${foundList.name} successfully.`);
                            resolve(foundList);
                        }
                    });
                }  
            });
        });
    }

    static async addItemToListAndGetUpdatedList(listName, itemName) {
        try {
            const updatedList = await DBUtility.addItemToListInDB(listName, itemName);
            console.log(`inside addItemToListAndGetUpdatedList. updatedList ${updatedList}`);
            return updatedList;
        } catch (err) {
            console.log(err);
        }  
    }
}

exports.DBUtility = DBUtility;
</code></pre>

<p>Output in Terminal:</p>

<pre><code>Server started, listening on port: 3000
before model.DBUtility.addItemToListAndGetUpdatedList(listName, receivedItem) 
After model.DBUtility.addItemToListAndGetUpdatedList(listName, receivedItem) 
updatedList: [object Promise]
Item Cheese added to list Shopping successfully. 
inside addItemToListAndGetUpdatedList. updatedList { 
  _id: 5e9cb7b45ceafe2440e09995,
  name: 'Shopping',
  items: [
    { _id: 5e9cb7c45ceafe2440e09999, name: 'Bread' },
    { _id: 5e9cb7cc5ceafe2440e0999a, name: 'Lemons' },
    { _id: 5e9cb7d25ceafe2440e0999b, name: 'Eggs' },
    { _id: 5e9cb7ea5ceafe2440e0999d, name: 'Butter' },
    { _id: 5e9cbd585ceafe2440e0999e, name: 'Cheese' }
  ],
  __v: 6
}
</code></pre>

<p>One thing to mention, and I hope this is not a red-herring, when I hosted MongoDB locally on my computer, I didn't recall having this issue. But when I moved to MongoDB Atlas cloud hosting, it seems like the issue started to occur. </p>

